MOD = 10**6 + 3

def mul(a, b):
    return (a * b) % MOD

def add(a, b):
    return (a + b) % MOD

def power(a, b):
    if b == 0:
        return 1
    if b % 2 == 0:
        return power(mul(a, a), b // 2)
    return mul(a, power(mul(a, a), (b - 1) // 2))

def div(a, b):
    return mul(a, power(b, MOD - 2))

def choose(n, k):
    if k > n:
        return 0
    if k * 2 > n:
        k = n - k
    res = 1
    for i in range(k):
        res = div(res, i + 1)
        res = mul(res, n - i)
    return res

def main():
    n, k = list(map(int, input().split()))
    n = 1 << n
    p = choose(n, k)
    print(p, n)
