MOD = 1000000007

def main():
    n = int(input())
    costs = list(map(int, input().split()))
    m = int(input())
    roads = [list(map(int, input().split())) for _ in range(m)]

    # dp[i][j] := min cost to protect all nodes in subtree rooted at i, with j checkposts
    # dp[i][j] = min(dp[k][j-1] + cost[i] for k in adj[i])
    # dp[i][0] = 0
    dp = [[float('inf')] * 2 for _ in range(n)]
    adj = [[] for _ in range(n)]
    for u, v in roads:
        adj[u-1].append(v-1)

    def dfs(i, p):
        dp[i][0] = 0
        for j in adj[i]:
            if j == p:
                continue
            dfs(j, i)
            for j1 in range(2):
                for j2 in range(2):
                    dp[i][j1 | j2] = min(dp[i][j1 | j2], dp[i][j1] + dp[j][j2])

    dfs(0, -1)
    ans1 = min(dp[0])
    ans2 = 0
    for j in range(2):
        ans2 = (ans2 + (dp[0][j] == ans1) * comb(sum(len(adj[i]) for i in range(n)), j)) % MOD
    print(ans1, ans2)

def comb(n, k):
    if k > n - k:
        k = n - k
    res = 1
    for i in range(k):
        res = res * (n - i) // (i + 1)
    return res

