import math

class Gear:
    def __init__(self, x, y, r):
        self.x = x
        self.y = y
        self.r = r

    def __str__(self):
        return "Gear(%d, %d, %d)" % (self.x, self.y, self.r)

    def __repr__(self):
        return self.__str__()

    def distance(self, other):
        return math.sqrt((self.x - other.x) ** 2 + (self.y - other.y) ** 2)

    def is_connected(self, other):
        return math.isclose(self.distance(other), self.r + other.r)

    def gear_ratio(self, other):
        return math.isclose(self.r, other.r) or math.isclose(self.r / other.r, 2) or math.isclose(self.r / other.r, 0.5)

    def ratio(self, other):
        if self.is_connected(other):
            if self.gear_ratio(other):
                return 1, 1
            elif self.r < other.r:
                return self.r, other.r
            else:
                return other.r, self.r
        else:
            return 0, 0

    def can_turn(self, other):
        ratio = self.ratio(other)
        return ratio[0] != 0 and ratio[1] != 0

    def turn_ratio(self, other):
        ratio = self.ratio(other)
        return ratio[0] // math.gcd(ratio[0], ratio[1]), ratio[1] // math.gcd(ratio[0], ratio[1])

