class Solution:
     def majorityElement(self, nums):
         """
         :type nums: List[int]
         :rtype: List[int]
         """
         if not nums:
             return []
         if len(nums) == 1:
             return nums
         num1, num2 = 0, 0
         count1, count2 = 0, 0
         for n in nums:
             if n == num1:
                 count1 += 1
             elif n == num2:
                 count2 += 1
             elif count1 == 0:
                 num1 = n
                 count1 = 1
             elif count2 == 0:
                 num2 = n
                 count2 = 1
             else:
                 count1 -= 1
                 count2 -= 1
         count1, count2 = 0, 0
         for n in nums:
             if n == num1:
                 count1 += 1
             elif n == num2:
                 count2 += 1
         res = []
         if count1 > len(nums)//3:
             res.append(num1)
         if count2 > len(nums)//3 and num1 != num2:
             res.append(num2)
         return res

