def even(n, m):
    n //= 2
    if m % (2 * n) == 0:
        k = m // (2 * n)
        return (2 * even(n, 2 * n) * pascal(k - 1, n - 1) + pascal(k, n - 1)) % MOD
    else:
        return 0

def odd(n, m):
    n //= 2
    if m % (2 * n + 1) == 0:
        k = m // (2 * n + 1)
        return (2 * odd(n, 2 * n + 1) * pascal(k - 1, n - 1) + pascal(k, n - 1)) % MOD
    else:
        return pascal(m % (2 * n + 1), n)

def pascal(n, k):
    if k == 0 or k == n:
        return 1
    return (pascal(n - 1, k - 1) + pascal(n - 1, k)) % MOD

