    xs = sorted(xs)
    ds = sorted(ds)
    x = xs[0]
    d = ds[0]
    for i in range(1, m):
        x += xs[i] - xs[i - 1]
        d += ds[i] - ds[i - 1]
    ans = 0
    for i in range(n):
        ans += x + d * abs(i - n // 2)
    return ans / n

