def time_to_minutes(time):
    h, m = time.split(':')
    return int(h) * 60 + int(m)

def minutes_to_time(minutes):
    h = minutes // 60
    m = minutes % 60
    return '{:02}:{:02}'.format(h, m)

def parse_time(time):
    h, m = time.split(':')
    return int(h), int(m)

def next_time(time, interval):
    h, m = parse_time(time)
    i_h, i_m = parse_time(interval)
    m += i_m
    if m >= 60:
        m -= 60
        h += 1
    h += i_h
    h %= 24
    return minutes_to_time(h * 60 + m)

