from math import gcd

def __gcd(a, b):
    while b:
        a, b = b, a % b
    return a

def __lcm(a, b):
    return a * b // __gcd(a, b)

def __dfs(nums, op, target):
    if not nums:
        return target == 0

    res = 0
    for i in range(len(nums)):
        if i > 0 and nums[i] == nums[i - 1]:
            continue
        if op == '+':
            res += __dfs(nums[:i] + nums[i + 1:], op, target - nums[i])
        elif op == '-':
            res += __dfs(nums[:i] + nums[i + 1:], op, target + nums[i])
        elif op == '*':
            res += __dfs(nums[:i] + nums[i + 1:], op, target // nums[i])
        else:
            if nums[i] % nums[i - 1]:
                continue
            res += __dfs(nums[:i] + nums[i + 1:], op, target * nums[i - 1] // nums[i])
    return res

def __solve(n, m, t, op):
    nums = []
    for _ in range(m):
        r, c = map(int, input().split())
        nums.append(r * n + c)

    return __dfs(sorted(nums), op, t)

def main():
    n, m, t, op = map(int, input().split())
    print(__solve(n, m, t, op))

