        self.visited.add(s)
        self.distance[s] = 0
        self.distance2[s] = 0
        self.distance3[s] = 0
        self.distance4[s] = 0
        queue = []
        queue.append(s)
        while queue:
            u = queue.pop(0)
            for v, w in self.graph[u]:
                if v not in self.visited:
                    self.visited.add(v)
                    queue.append(v)
                    self.distance[v] = self.distance[u] + w
                    if v == d:
                        return self.distance[v]
            if u == s:
                for v in self.graph[u]:
                    if v[0] not in self.visited:
                        queue.append(v[0])
                        self.distance2[v[0]] = self.distance2[u] + v[1]
                        if v[0] == d:
