from collections import defaultdict

def prime_factors(n):
    i = 2
    factors = defaultdict(int)
    while i * i <= n:
        while (n % i) == 0:
            factors[i] += 1
            n //= i
        i += 1
    if n > 1:
        factors[n] += 1
    return factors

def get_factors(factors):
    if not factors:
        return [()]
    ans = []
    for i in range(factors[2] + 1):
        for rest in get_factors({k: v - i for k, v in factors.items() if k != 2}):
            ans.append((2**i,) + rest)
    return ans

