from collections import defaultdict

class BoardGame:
    def __init__(self, n):
        self.n = n
        self.graph = defaultdict(list)
        self.visited = defaultdict(lambda: False)
        self.dist = defaultdict(lambda: -1)
        self.start = None
        self.end = None

    def add_edge(self, u, v):
        self.graph[u].append(v)

    def read_input(self):
        for i in range(self.n):
            line = input().split()
            m = int(line[0])
            line = line[1:]
            for j in range(m):
                self.add_edge(line[j], line[j+m])
        self.start = input()
        self.end = input()

    def bfs(self):
        self.dist[self.start] = 0
        self.visited[self.start] = True
        queue = [self.start]
        while queue:
            u = queue.pop(0)
            for v in self.graph[u]:
                if not self.visited[v]:
                    self.dist[v] = self.dist[u] + 1
                    self.visited[v] = True
                    queue.append(v)

    def solve(self):
        self.bfs()
        if self.dist[self.end] == -1:
            print(-1, end=' ')
        else:
            print(self.dist[self.end], end=' ')
        for i in range(self.n):
            line = input().split()
            print(line.index(self.end), end=' ')
        print()

def main():
    t = int(input())
    for i in range(t):
        n = int(input())
        board_game = BoardGame(n)
        board_game.read_input()
        board_game.solve()

if __name__ == '__main__':
    main()

