        print(' '.join(map(str, matrix[row])))

def print_str_matrix_mxn(matrix, m):
    for row in range(m):
        print(' '.join(matrix[row]))

def dfs1(u, adj, visited, stack):
    visited[u] = True
    for v in adj[u]:
        if not visited[v]:
            dfs1(v, adj, visited, stack)
    stack.append(u)

def dfs2(u, adjT, visited):
    visited[u] = True
    for v in adjT[u]:
        if not visited[v]:
            dfs2(v, adjT, visited)

def kosaraju(n, adj, adjT):
    visited = [False] * (n + 1)
    stack = []
    for i in range(1, n + 1):
        if not visited[i]:
            dfs1(i, adj, visited, stack)
    visited = [False] * (n + 1)
    scc = 0
    while stack:
        u = stack.pop()
        if not visited[u]:
            dfs2(u, adjT, visited)
            scc += 1
    return scc

def solve():
    n, k = read_ints()
    pos = read_int_list()
    adj = defaultdict(list)
    adjT = defaultdict(list)
    for i in range(n):
        adj[pos[i]].append(i + 1)
        adjT[i + 1].append(pos[i])
    if k % (n - 1) != 0:
        print("Impossible")
        return
    scc = kosaraju(n, adj, adjT)
    if scc != 1:
        print("Impossible")
        return
    print(" ".join(map(str, pos)))

def main():
    t = read_int()
    for i in range(t):
        solve()

