from collections import defaultdict, deque

def dijkstra(graph, start):
    dist = {start: 0}
    queue = deque([(0, start)])
    while queue:
        (d, v) = queue.popleft()
        if v in dist and d > dist[v]:
            continue
        for (w, d2) in graph[v]:
            if w in dist and d + d2 >= dist[w]:
                continue
            dist[w] = d + d2
            queue.append((d + d2, w))
    return dist

