def parse(molecule):
    result = {}
    i = 0
    while i < len(molecule):
        atom = ''
        while i < len(molecule) and molecule[i].isalpha():
            atom += molecule[i]
            i += 1
        if i < len(molecule) and molecule[i].isdigit():
            number = ''
            while i < len(molecule) and molecule[i].isdigit():
                number += molecule[i]
                i += 1
            number = int(number)
        else:
            number = 1
        if atom not in result:
            result[atom] = 0
        result[atom] += number
    return result

def gcd(a, b):
    while b:
        a, b = b, a % b
    return a

def solve(input, output):
    input = parse(input)
    output = parse(output)
    result = float('inf')
    for atom in output:
        if atom not in input:
            return 0
        g = gcd(input[atom], output[atom])
        result = min(result, input[atom] // output[atom] // g)
    return result

